  return <div>{json}</div>;
};

export default PostPage;

PostPage.getInitialProps = async (ctx) => {
  const res = await fetch("https://cat-fact.herokuapp.com/facts/1");
  const json = await res.json();
  return {
    stars: json.stargazers_count
  }
};
